import React, { Component } from 'react'
import { Input, Button } from 'antd'

class Head extends Component {
    render() {
        return (
            <div>
                <Input id={"user"} />
                <Input id={"pass"} />
                <Button onClick={this.Login}>LOGIN</Button>
            </div>
        )
    }
} export default Head
